sys_variable_value.value:
(function execute(inputs, outputs) {
    var obs = new OracleBlockStorageUtils();
    obs.validateInputVariables(inputs, outputs);
    obs.validateMandatoryVariables(inputs, ["availability_domain", "compartment_id", "display_name"]);
  var requestBody = {
      "availabilityDomain": inputs.availability_domain,
      "compartmentId": inputs.compartment_id,
      "displayName": inputs.display_name,
      "vpusPerGB": inputs.vpus_per_gb,
    "isAutoTuneEnabled": inputs.is_auto_tune_enabled 
  };

  if(inputs.size_in_gbs)
  {
    if(inputs.size_in_gbs<50 || inputs.size_in_gbs>32768){
    throw new Error("Size must be between 50 GB and 32,768 GB");
    }
  requestBody.sizeInGBs = inputs.size_in_gbs;
  }
  if(inputs.backup_policy_id)
  {
  requestBody.backupPolicyId = inputs.backup_policy_id;
  }
  obs.trimValues(inputs.freeformtags);
  var tags = obs.createTagsPayload(inputs.freeformtags);
  if(Object.keys(tags).length){
        requestBody.freeformTags = tags;
  }
    outputs.payload = JSON.stringify(requestBody);
})(inputs, outputs);

